import React from "react";
import ListGroup from "react-bootstrap/ListGroup";
import { Badge } from "react-bootstrap";

const TodoItem = (props) => {
	let itemHtml = (
		<>
			<span className="done">{props.todo.text}</span>
			<Badge

				className="float-end"
			>
				&#128077;
			</Badge>
		</>
	);

	if (props.todo.done === false) {
		itemHtml = (
			<>
				<span className="done" onClick={() => props.markasDone(props.todo.id)}>{props.todo.text}</span>
				<Badge className="float-end">&#128078;</Badge>
			</>
		);
	}

	return <ListGroup.Item>{itemHtml}</ListGroup.Item>;
};

export default TodoItem;
